css:
atom-text-editor.editor {
  background-color: black;
}
atom-text-editor.editor.is-focused .selection .region {
  background-color: #400;
}
atom-text-editor.editor:not(.is-focused) .selection .region {
  background-color: #311;
}
atom-text-editor.editor .wrap-guide {
  background: none;
}
atom-panel-container.bottom atom-text-editor.mini.is-focused,
atom-panel-container.bottom atom-text-editor.mini:hover {
  background-color: #311;
}
